URL url = new URL("https://apigateway.bnymellon.com/etfdataservices/v1/baskets");
HttpURLConnection con = (HttpURLConnection) url.openConnection();
System.out.println("Opened connection");
con.setRequestMethod("POST");
con.setRequestProperty("Authorization", "Bearer " + (String)globalMap.get("token"));
con.setRequestProperty("Content-Type", "application/json; utf-8");
con.setRequestProperty("Accept", "application/json");
con.setDoOutput(true);
System.out.println("configured");

// here is the main part of the component,
// a piece of code executed in the row
// loop
try(OutputStream os = con.getOutputStream()) {
    byte[] input = row7.jsonString.getBytes("utf-8");
    os.write(input, 0, input.length);			
}
System.out.println("POSTed request content");

// Store ResponseCode
int status = con.getResponseCode();
System.out.println("Content-Encoding: " + con.getHeaderField("Content-Encoding"));

// Inflat gzip stream (the API response content is gziped)
GZIPInputStream gzis = new GZIPInputStream(con.getInputStream());
InputStreamReader reader = new InputStreamReader(gzis);
BufferedReader in = new BufferedReader(reader);

// Send the output to next component, line by line
String readed;
while ((readed = in.readLine()) != null) {
	readed = in.readLine();
	if (readed != null) {
		row6.content += readed;
	}
}
row6.responseCode = status;

